			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "#I would preffer this in \"build\", but XCode 3 does not allow Makefiles inside \"build\" so we go with /tmp and clean it up\nQEMUPATCHDIRECTORY=\"/tmp\"\nQEMUROOT=\"$SRCROOT/qemu\"\n\n#check if a built version already exists, else copy, patch, build and cleanup sources\ntest -e \"$TARGET_TEMP_DIR/i386-softmmu/qemu\" || {\n\trm -rf \"$QEMUPATCHDIRECTORY/qemu\" > /dev/null\n\tmkdir -p \"$QEMUPATCHDIRECTORY\"\n\tcp -r \"qemu/qemu\" \"$QEMUPATCHDIRECTORY\"\n\tcd \"$QEMUPATCHDIRECTORY/qemu\"\n\n\tif test $(echo $MACHTYPE | grep powerpc); then\n\t\t# add patches for PPC\n\t\techo \"PPC\" > /dev/null\n\telse\n\t\t# add patches for Intel\n\t\tpatch -p1 -u < \"$QEMUROOT/patches/qemu-0.9.1-gcc4.patch\"\n\t\tpatch -p1 -u < \"$QEMUROOT/patches/qemu-0.7.2-dyngen-check-stack-clobbers.patch\"\n\t\tpatch -p1 -u < \"$QEMUROOT/patches/qemu-0.9.1-gcc4-opts.patch\"\n\t\tpatch -p1 -u < \"$QEMUROOT/patches/qemu-0.9.1-gcc4-hacks.patch\"\n\t\tpatch -p1 -u < \"$QEMUROOT/patches/qemu-0.9.1-enforce-16byte-stack-boundary.patch\"\n\t\tpatch -p1 -u -f < \"$QEMUROOT/patches/qemu-0.9.0-i386-FORCE_RET.patch\"\n\t\tpatch -p1 -u < \"$QEMUROOT/patches/qemu-0.9.1-osx-intel-port.patch\"\n\t\tpatch -p1 -u < \"$QEMUROOT/patches/qemu-0.9.1-osx-bugfix.patch\"\n\tfi\n\n\t# Q ***** Leopard patches\n\tpatch -p0 -u < \"$QEMUROOT/patches/Leopard-dyngen.dSYM.diff\"\n\tpatch -p0 -u < \"$QEMUROOT/patches/qemu-img-CF+IO.diff\"\n\tpatch -p1 -u < \"$QEMUROOT/patches/qemu-0.9.1-always_inline.patch\"\n\n\t# Q ***** add 2nd Bootdevice\n\t#patch -p0 -u <   \"$QEMUROOT/patches/qemu-2ndbootdevice_04.diff\"\n\n\t# Q ***** use custom cocoa.m\n\tcp \"$QEMUROOT/patches/cocoa.m\" \"$QEMUPATCHDIRECTORY/qemu/cocoa.m\"\n\n\tpatch -p0 -u < \"$QEMUROOT/patches/q_block_int.h_hdled_1.diff\"\n\tpatch -p0 -u < \"$QEMUROOT/patches/q_block.c_hdled_1.diff\"\n\n\tmkdir -p \"$TARGET_TEMP_DIR\"\n\tcd \"$TARGET_TEMP_DIR\"\n\n\t# build only for i386 by default\n\t\"$QEMUPATCHDIRECTORY/qemu/./configure\" --prefix=.. --enable-cocoa --enable-adlib --disable-gcc-check --target-list=i386-softmmu\n\n\t# uncomment if you want to build all targets\n\t#\"$QEMUPATCHDIRECTORY/qemu/./configure\" --prefix=../products/i386 --enable-cocoa --enable-adlib --disable-gcc-check --target-list=i386-softmmu,ppc-softmmu,sparc-softmmu,mips-softmmu,arm-softmmu\n\n\t#make\n\tmake\n\n\t#backup bios files\n\tmkdir -p \"$TARGET_TEMP_DIR/pc-bios/\"\n\tcd \"$QEMUPATCHDIRECTORY/qemu/pc-bios/\"\n\tcp *.bin \"$TARGET_TEMP_DIR/pc-bios/\"\n\tcd -\n\n\t#cleanup\n\trm -rf \"$QEMUPATCHDIRECTORY/qemu\" > /dev/null\n}\n\n#create and copy qemu bins\nrm -rf   \"$BUILD_DIR/$CONFIGURATION/Q.app/Contents/Resources/bin/*-softmmu\" > /dev/null\nmkdir -p \"$BUILD_DIR/$CONFIGURATION/Q.app/Contents/Resources/bin/\"\ncp \"$TARGET_TEMP_DIR/i386-softmmu/qemu\" \"$BUILD_DIR/$CONFIGURATION/Q.app/Contents/Resources/bin/i386-softmmu\"\n\n#create and copy bios\nrm -rf   \"$BUILD_DIR/$CONFIGURATION/Q.app/Contents/Resources/share/qemu\" > /dev/null\nmkdir -p \"$BUILD_DIR/$CONFIGURATION/Q.app/Contents/Resources/share/qemu/\"\ncd \"$TARGET_TEMP_DIR/pc-bios/\"\ncp *.bin \"$BUILD_DIR/$CONFIGURATION/Q.app/Contents/Resources/share/qemu/\"\n";
		};
